import { useEffect, useState } from "react";
import { getUserIn4Api } from "./api/UserApiService";
import { useAuth } from "./security/AuthContext";
import { useNavigate } from "react-router-dom";

function UserProfileComponent() {

    const [todos, setTodos] = useState([])
    const [message, setMessage] = useState(null)
    const navigate = useNavigate();
    useEffect(() => refresh(), [])

    function refresh() {
        getUserIn4Api()
            .then(response => {
                setTodos(response.data)
            })
            .catch(error => console.log(error))

    }
    // function deleteTodo(id) {
    //     deleteTodoApi(id)
    //         .then(
    //             () => {
    //                 setMessage(`Deletion of todo with ID = ${id} was successful!`)
    //                 refreshTodos()
    //             }

    //             //1: Display message
    //             //2: Update Todos list
    //         )
    //         .catch(error => console.log(error))

    // }

    // function updateTodo(id) {
    //     navigate(`/todo/${id}`)

    // }
    function addNewTodo() {
        navigate('/todo/-1')

    }
    function noteTodo(id) {
        navigate(`/todo/${id}/note`)
    }


    return (
        <div className="container">
            <h1>Things You Want To Do! </h1>
            {message && <div className="alert alert-warning">{message}</div>}

            <div class="vh-100" style="background-color: #eee;">
                <div class="container py-5 h-100">
                    <div class="row d-flex justify-content-center align-items-center h-100">
                        <div class="col-md-12 col-xl-4">

                            <div class="card" style="border-radius: 15px;">
                                <div class="card-body text-center">
                                    <div class="mt-3 mb-4">
                                        <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava2-bg.webp"
                                            class="rounded-circle img-fluid" style="width: 100px;" />
                                    </div>
                                    <h4 class="mb-2">Julie L. Arsenault</h4>
                                    <p class="text-muted mb-4">@Programmer <span class="mx-2">|</span> <a
                                        href="#!">mdbootstrap.com</a></p>
                                    <div class="mb-4 pb-2">
                                        <button type="button" class="btn btn-outline-primary btn-floating">
                                            <i class="fab fa-facebook-f fa-lg"></i>
                                        </button>
                                        <button type="button" class="btn btn-outline-primary btn-floating">
                                            <i class="fab fa-twitter fa-lg"></i>
                                        </button>
                                        <button type="button" class="btn btn-outline-primary btn-floating">
                                            <i class="fab fa-skype fa-lg"></i>
                                        </button>
                                    </div>
                                    <button type="button" class="btn btn-primary btn-rounded btn-lg">
                                        Message now
                                    </button>
                                    <div class="d-flex justify-content-between text-center mt-5 mb-2">
                                        <div>
                                            <p class="mb-2 h5">8471</p>
                                            <p class="text-muted mb-0">Wallets Balance</p>
                                        </div>
                                        <div class="px-3">
                                            <p class="mb-2 h5">8512</p>
                                            <p class="text-muted mb-0">Income amounts</p>
                                        </div>
                                        <div>
                                            <p class="mb-2 h5">4751</p>
                                            <p class="text-muted mb-0">Total Transactions</p>
                                        </div>
                                    </div>
                                </div>
                            </div>

                        </div>
                    </div>
                </div>
            </div>

            <button type="button" className="btn btn-secondary btn-lg custom-button m-5" onClick={addNewTodo} >Add New Todo</button>
        </div>
    )
}

export default UserProfileComponent
